import Vue from 'vue'
import { createWebHashHistory, Router } from 'vue-router';
//import App from './App.vue'
import routes from '@/assets/script/index.js'

const router = Router.createRouter({
    history: createWebHashHistory(),
    routes
})

const vue = Vue.createApp({});

vue.use(router);
vue.mount('#app');
